import React from 'react';
import { Menu, Container } from 'semantic-ui-react';
import {Link, Router} from 'next-routes';

export default () => {
    return (
        <Menu color='blue' inverted>
            <Container>
            <Link >
                <a>er</a>
            </Link>

            <Menu.Menu position="right">
                <Menu.Item>
                    Login
                </Menu.Item>

            </Menu.Menu>
            </Container>
        </Menu>
    );
}
